import React from "react";
import Header from "./header";
import SubHeder from "./subHeader";
import Footer from "./footer";
import { Button } from "antd";
import logo from "./logo.svg";
import landingMainImage from "./images/landing-page-main-img.png";
import landingStarImage from "./images/landing-page-star-img.png";

import "./index.css";
import "./App.css";

function App() {
  return (
    <>
      <Header />
      <SubHeder />
      <img src={landingMainImage} className="landing-main-img" alt="mainimg" />
      <div className="welcome-div">
        <p className="welcome-paragraph">
          WELCOME TO
          <br />
          <br />
          YOUR JOURNEY THROUGH
          <br />
          <br />
          CUSTOMER EXPERIENCE
        </p>
        <button className="landing-button">Be part of the conversation</button>
      </div>

      <img src={landingStarImage} className="landing-star-img" alt="starimg" />
      <Footer />
    </>
  );
}

export default App;
